        <div className="infoCard">
            <div className="infoImg" alt="">
                <img src={props.icon} />
            </div>

            <div className="infoTitle">
                <h2>{props.title}</h2>
            </div>

            <div className="infoDesc">
                <p>{props.description}</p>
            </div>
        </div>
    )
}
